import {react, useState} from 'react';
import VideoPop from 'react-video-pop';
import './Demo.css';
import ReactPlayer from 'react-player'
import { propTypes } from 'react-bootstrap/esm/Image';





const Demo= (props)=>
{



return (
<>


<div className="demo__video">
<ReactPlayer
                    className='header_video'
                    url={props.url}
                    width='100%'
                    height='100%'
                    controls={false}
                    loop={true}
                    playing={true}
                />


</div>
    

</>


)



}


export default Demo;
